import React from "react";
import "./Skills.css";
import Data from "../Data/Data";

const Skills = () => {
    const data = Data[0]["skills"]; // Veriyi alın

    return (
        <div class="skills">
            <h2>Skills</h2>
            <div className="skills-content">



            {data.map((item) => (
                <div className="skill"><img src={data["img-link"]} alt={data.alt} /><span>{data.alt}</span></div>

            ))}


            </div>
        </div>
    )
}
export default Skills
